import React from 'react';
import './style.css';
import NewItemForm from '../NewItemForm/index.js';

class NewItemContainer extends React.Component{

	render(){
		const infos = this.props;
		return(
			<div className="newItemContainer">

				<NewItemForm className="containerForm" 
							 itemName={infos.newItemName}
							 itemQuantity={infos.newItemQuantity}
							 temPrice={infos.newItemPrice}
							 inputChange={infos.onInputChange}
							 itemSubmit={infos.handleSubmit}/>
			</div>
		);
	}
}

export default NewItemContainer;
